Step 1: Identify Net Profit from the Income Statement. In this problem, Net Profit is 1,167,783.63.

Step 2: Calculate the Average Total Assets using the Balance Sheet figures. The beginning total assets (at 2023-12-31) are 13,000,000.00 and the ending total assets (at 2024-02-05) are 14,799,664.61.  
  Average Total Assets = (13,000,000.00 + 14,799,664.61) / 2 = 13,899,832.305

Step 3: Compute the ROA using the formula:  
  ROA = (Net Profit / Average Total Assets) × 100%  
  ROA = (1,167,783.63 / 13,899,832.305) × 100% ≈ 8.40%

Thus, the Return on Assets (ROA) is 8.40%.

